    [],nt"num_tags": 7,nt"name": "tamarac-national-wildlife-refuge-annual-narrative-report-calendar-year-1994-ff15c",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Tamarac
    National Wildlife Refuge summarizes Refuge activities during the 1994 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the management plan, compliance with environmental and cultural resource
    mandates, research, and investigations.  Refuge administration is outlined; information
    about personnel, youth programs, manpower programs, volunteer programs, funding,
    and safety is given.  Habitat management is also covered.  Subjects include wetlands,
    forests, croplands, grasslands, fire management, pest control, Farmers Home Administration
    Conservation Easements, and private lands.  The wildlife section of the report discusses
    wildlife diversity, endangered species, waterfowl, marsh birds, waterbirds, shorebirds,
    raptors, game mammals, fisheries resources, wildlife propagation and stocking, marking,
    banding, and disease control.  The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife
    observation, law enforcement, and cooperating associations.  The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization/replacement, communications systems, communication
    systems, and energy conservation.  Cooperative programs, economic uses of the Refuge,
    and items of interest are provided at the end; Refuge brochures are attached.",nt"owner_org":
